///Make sure that the field for your file is a string
//If you have multiple file uploads in your schema make it a list of strings @Serializable
data class FileUploadRecord(val imageFile: String, val imageDescription: String) : Record() client.records.create<FileUploadRecord>( "fileUploadCollection", //A workaround to the limitations on JSON with multipart form data mapOf( "imageDescription" to "A house".toJsonPrimitive() ), //Here is where the files are uploaded from //Swap ByteArray(0) with the file's content as a ByteArray listOf( FileUpload("imageFile", ByteArray(0), "house.png") )
