Logging the client in allows it to call methods that require Pocketbase authentication. The current login token is saved and applied to every api request. Auth Store If you want to persistently store the token, you can extend BaseAuth and store the token using SharedPreferences or another database: // Using SharedPreferences
const val TOKEN_KEY = "token"
class AuthStore(var sharedPreferences: SharedPreferences) : BaseAuthStore(null) { init { this.token = sharedPreferences.getString(TOKEN_KEY, null) } override fun save(token: String?) { super.save(token) sharedPreferences.edit() .putString(TOKEN_KEY, token) .apply() } override fun clear() { super.clear() sharedPreferences.edit() .putString(TOKEN_KEY, null) .apply() }
} // Set store in client settings
val client = PocketbaseClient({ //...
}, store = AuthStore(sharedPreferences)) Logging in via username/email and password // Logging in as an admin
client.admins.authWithPassword("email", "password").token // Using the collection auth service to log in
// This authenticates a user rather than an admin
// The user auth service is the same as collection auth, but it uses the "users" collection
client.records.authWithPassword<User>("collectionName", "email", "password").token
client.records.authWithUsername<User>("collectionName", "username", "password").token Logging in via OAuth //You can also use oauth2
client.records.authWithOauth2<User>("collectionName", "provider", "code", "codeVerifier", "redirectUrl").token Logging in via token client.login { token = "xxx" } Logging out client.logout()

